import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import './sidebar.css';
import '../../custom.scss';

function Example() {
  return (
        <Container className="container-fluid height-full bg-dark">
            <Col/>
        </Container>
    )
}

export default Example;
